import React from "react";

const Nav = () => (
  <nav className="bg-gray-800 text-white p-4 flex justify-between">
    <div className="font-bold">AccessMate</div>
    <ul className="flex space-x-4">
      <li tabIndex="0" aria-label="Home link">Home</li>
      <li tabIndex="0" aria-label="About section">About</li>
      <li tabIndex="0" aria-label="Help section">Help</li>
    </ul>
  </nav>
);

export default Nav;
